<script>

function checkNums(num1,num2) {
  result = ''

  if(num2 > num1) {
    result = true;
  } else if (num1 > num2) {
    result = false
  } else if (num1 == num2) {
    result = -1
  }

  return result
}

// Correct Sample Outputs
// Input = 3 & num2 = 122 Output = "true"
// Input = 67 & num2 = 67 Output = "-1"

console.log(checkNums(3, 122))
console.log(checkNums(67, 67))

</script>
